import React from 'react';

function Input(props) {

    const [value, setValue] = useState("");

    return (
        <div>
            <input type="text" className='form-control' placeholder='请输入待办事项' value={value} onChange={(e) => setValue(e.target.value)} />
            <button>提交</button>
        </div>
    );
}

export default Input;
